(4561, 2, 'resumo_produtos', 'Fabricamos uma variada gama de produtos nos segmentos como segue de Papelaria como placas, bolo falso, letras, blocos cones, peças especiais; Embalagens industriais como calços, bups, calços colados; Construção civil como tavela laje, enchimento para laje, flocos para concreto leve, placas para forro,  moldura cimentícia decorativa externa, sancas internas; Placas para fabricação de colchões; Blocos para usinagem; Blocos para esculpir; Blocos para fabricação de pranchas surf, stand up, race, já no formato da prancha incluisive usinadas; Desenvolvemos novos projetos conforme a necessidade'),
