(4575, 561, 'resumo_produtos', 'Fundada em 1993, atuamos no recorte de isopor, com máquinas automáticas CNC, fabricamos uma variada gama de produtos nos segmentos de papelaria, embalagens e construção civil.\r\nContamos com frota própria de caminhões facilitando e garantindo a qualidade no envio dos produtos.\r\nAuxiliamos o cliente no desenvolvimento de produtos específicos na linha de embalagens técnicas e na  construção civil.\r\nTemos uma equipe de vendas treinada para o melhor atendimento, além de um canal aberto diretamente com a diretoria para eventuais dúvidas e solução de problemas.'),
