(4589, 563, 'resumo_produtos', 'Fabricamos uma variada gama de produtos nos segmentos como segue:\r\nPapelaria: placas, bolo falso, letras, blocos cones, peças especiais\r\nEmbalagens: calços, bups, calços colados\r\nConstrução civil: tavela laje, enchimento para laje, flocos para concreto leve, placas para forro, placas para isolamento térmico, calhas bi partida para isolação térmica tubulações, moldura cimentícia decorativa externa, sancas internas, placas para proteção de piscinas, colunas decorativas\r\nPlacas para fabricação de colchões\r\nBlocos para usinagem\r\nBlocos para esculpir\r\nBlocos para fabricação de pranchas surf, stand up, race, já no formato da prancha incluisive usinadas\r\nDesenvolvemos novos projetos conforme a necessidade'),
