(2, 1, '2017-11-14 11:04:04', '2017-11-14 13:04:04', 'Fundada em 1993, atuamos no recorte de isopor, com máquinas automáticas CNC.\r\nContamos com frota própria de caminhões facilitando e garantindo a qualidade no envio dos produtos.\r\nAuxiliamos o cliente no desenvolvimento de produtos específicos na linha de embalagens técnicas e na construção civil.\r\nTemos uma equipe de vendas treinada para o melhor atendimento, além de um canal aberto diretamente com a diretoria para eventuais dúvidas e solução de problemas.', 'Home', '', 'publish', 'closed', 'closed', '', 'pagina-exemplo', '', '', '2018-01-16 10:08:30', '2018-01-16 12:08:30', '', 0, 'http://localhost/styroville/?page_id=2', 0, 'page', '', 0),
