(566, 3, '2018-01-04 09:51:46', '2018-01-04 11:51:46', 'Fundada em 1993, a empresa conta hoje com uma variada gama de produtos, atuando nos mais variados segmentos como PAPELARIA/DECORAÇÃO, EMBALAGENS INDUSTRIAIS, CONSTRUÇÃO CIVIL, PRANCHAS PARA SURF, BLOCOS PARA USINAGEM/ESCULPIR, são dentre algumas delas.\r\n\r\nContamos hoje com uma equipe treinada e especializada no desenvolvimento de produtos que atendam a necessidade dos clientes.\r\n\r\nTemos frota própria de caminhões para garantir a qualidade dos produtos e maior agilidade nas entregas.\r\n\r\nCom máquinas automáticas CNC, temos um parque fabril amplo e com alta capacidade de produção buscando sempre atender as necessidades.', 'Conheça-nos', 'A empresa foi fundada em 1970 por um grupo de empreendedores com o objetivo de contribuir com o desenvolvimento econômico da região, gerar empregos e diversificar a atividade.', 'inherit', 'closed', 'closed', '', '196-revision-v1', '', '', '2018-01-04 09:51:46', '2018-01-04 11:51:46', '', 196, 'http://www.ultimate.com.br/styroville/noticias/196-revision-v1/', 0, 'revision', '', 0),
