(572, 3, '2018-01-04 13:33:56', '2018-01-04 15:33:56', 'Contamos com máquinas automáticas CNC.\r\n\r\nEstamos constantemente renovando nosso parque fabril afim de oferecer o melhor produto aos clientes.\r\n\r\nTemos uma equipe especializada devidamente treinada e habilitada visando sempre manter a qualidade dos produtos fabricados e oferecidos aos clientes.\r\n\r\nDispomos também de um departamento técnico pronto a atender e resolver os problemas que eventualmente surjam no atendimento.', 'Qualidade', '', 'inherit', 'closed', 'closed', '', '251-revision-v1', '', '', '2018-01-04 13:33:56', '2018-01-04 15:33:56', '', 251, 'http://www.ultimate.com.br/styroville/noticias/251-revision-v1/', 0, 'revision', '', 0),
(573, 3, '2018-01-04 13:42:35', '2018-01-04 15:42:35', 'Faça parte de nossa equipe de trabalho, temos várias unidades onde sempre temos oportunidades para profissionais dispostos a novos desafios.\n\nFavo enviar seu curriculun com todas informações, nossa equipe de RH entrará em contato em breve.', 'Trabalhe Conosco', 'Venha fazer parte da equipe Têxtiloeste. Preencha nosso formulário e envie seu currículo para nós.', 'inherit', 'closed', 'closed', '', '218-autosave-v1', '', '', '2018-01-04 13:42:35', '2018-01-04 15:42:35', '', 218, 'http://www.ultimate.com.br/styroville/noticias/218-autosave-v1/', 0, 'revision', '', 0),
(575, 3, '2018-01-04 14:00:00', '2018-01-04 16:00:00', 'Fabricamos peças especiais para cada estilo.\n\nColunas Maciças ou ocas, cilíndricas ou quadradas, caneladas ou lisas, produzidas conforme a necessidade do cliente.\nDisponibilizamos modelos somente em isopor ou também revestidos com argamassa cimentícia, pronto para aplicação na obrra\n\nDesenvolvemos também capiteis, letreiros, logotipos, conforme projeto.', 'Colunas em isopor', '', 'inherit', 'closed', 'closed', '', '512-autosave-v1', '', '', '2018-01-04 14:00:00', '2018-01-04 16:00:00', '', 512, 'http://www.ultimate.com.br/styroville/noticias/512-autosave-v1/', 0, 'revision', '', 0),
