(603, 3, '2018-01-17 14:32:10', '2018-01-17 16:32:10', 'Fundada em 1993, atuamos no segmento de POLIESTIRENO EXPANDIDO, mais conhecido como ISOPOR, com a sigla de EPS, a empresa conta hoje com uma variada gama de produtos, atuando nos mais variados segmentos como PAPELARIA/DECORAÇÃO, EMBALAGENS INDUSTRIAIS, CONSTRUÇÃO CIVIL, PRANCHAS PARA SURF, BLOCOS PARA USINAGEM/ESCULPIR, são dentre algumas delas.\r\n\r\nContamos hoje com uma equipe treinada e especializada no desenvolvimento de produtos que atendam a necessidade dos clientes.\r\n\r\nTemos frota própria de caminhões para garantir a qualidade dos produtos e maior agilidade nas entregas.\r\n\r\nCom máquinas automáticas CNC, temos um parque fabril amplo e com alta capacidade de produção buscando sempre atender as necessidades.', 'Conheça-nos', 'Fundada em 1993, atuamos no segmento de POLIESTIRENO EXPANDIDO, mais conhecido como ISOPOR, com a sigla de EPS, a empresa conta hoje com uma variada gama de produtos, atuando nos mais variados segmentos como PAPELARIA/DECORAÇÃO, EMBALAGENS INDUSTRIAIS,', 'inherit', 'closed', 'closed', '', '196-revision-v1', '', '', '2018-01-17 14:32:10', '2018-01-17 16:32:10', '', 196, 'http://www.ultimate.com.br/styroville/noticias/196-revision-v1/', 0, 'revision', '', 0),
(600, 2, '2018-01-16 11:47:41', '2018-01-16 13:47:41', 'Faça parte de nossa equipe de trabalho, temos várias unidades onde sempre temos oportunidades para profissionais dispostos a novos desafios.\r\n\r\nFavo enviar seu curriculum com todas informações, nossa equipe de RH entrará em contato em breve.', 'Trabalhe Conosco', 'Faça parte de nossa equipe de trabalho, temos várias unidades onde sempre temos oportunidades para profissionais dispostos a novos desafios.', 'inherit', 'closed', 'closed', '', '218-revision-v1', '', '', '2018-01-16 11:47:41', '2018-01-16 13:47:41', '', 218, 'http://www.ultimate.com.br/styroville/noticias/218-revision-v1/', 0, 'revision', '', 0),
