(606, 3, '2018-01-17 14:40:30', '2018-01-17 16:40:30', 'Fundada em 1993, atuamos no segmento de POLIESTIRENO EXPANDIDO, mais conhecido como ISOPOR, com a sigla de EPS, a empresa conta hoje com uma variada gama de produtos, atuando nos mais variados segmentos como PAPELARIA/DECORAÇÃO, EMBALAGENS INDUSTRIAIS, CONSTRUÇÃO CIVIL, PRANCHAS PARA SURF, BLOCOS PARA USINAGEM/ESCULPIR, são dentre algumas delas.\r\n\r\nContamos hoje com uma equipe treinada e especializada no desenvolvimento de produtos que atendam a necessidade dos clientes.\r\n\r\nTemos frota própria de caminhões para garantir a qualidade dos produtos e maior agilidade nas entregas.\r\n\r\nCom máquinas automáticas CNC, temos um parque fabril amplo e com alta capacidade de produção buscando sempre atender as necessidades.', 'Conheça-nos', 'Fundada em 1993, atuamos no segmento de POLIESTIRENO EXPANDIDO, mais conhecido como ISOPOR, com a sigla de EPS, a empresa conta hoje com uma variada gama de produtos, atuando nos mais variados segmentos como PAPELARIA/DECORAÇÃO, EMBALAGENS INDUSTRIAIS,', 'inherit', 'closed', 'closed', '', '196-revision-v1', '', '', '2018-01-17 14:40:30', '2018-01-17 16:40:30', '', 196, 'http://www.ultimate.com.br/styroville/noticias/196-revision-v1/', 0, 'revision', '', 0),
