(561, 3, '2018-01-04 09:22:25', '2018-01-04 11:22:25', '', 'Home', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2018-01-04 09:22:25', '2018-01-04 11:22:25', '', 2, 'http://www.ultimate.com.br/styroville/noticias/2-revision-v1/', 0, 'revision', '', 0),
(562, 3, '2018-01-04 09:23:44', '2018-01-04 11:23:44', 'Fundada em 1993, atuamos no recorte de isopor, com máquinas automáticas CNC.\nContamos com frota própria de caminhões facilitando e garantindo a qualidade no envio dos produtos.\nAuxiliamos o cliente no desenvolvimento de produtos específicos na linha de embalagens técnicas e na construção civil.\nTemos uma equipe de vendas treinada para o melhor atendimento, além de um canal aberto diretamente com a diretoria para eventuais dúvidas e solução de problemas.', 'Home', '', 'inherit', 'closed', 'closed', '', '2-autosave-v1', '', '', '2018-01-04 09:23:44', '2018-01-04 11:23:44', '', 2, 'http://www.ultimate.com.br/styroville/noticias/2-autosave-v1/', 0, 'revision', '', 0),
(563, 3, '2018-01-04 09:29:52', '2018-01-04 11:29:52', 'Fundada em 1993, atuamos no recorte de isopor, com máquinas automáticas CNC.\r\nContamos com frota própria de caminhões facilitando e garantindo a qualidade no envio dos produtos.\r\nAuxiliamos o cliente no desenvolvimento de produtos específicos na linha de embalagens técnicas e na construção civil.\r\nTemos uma equipe de vendas treinada para o melhor atendimento, além de um canal aberto diretamente com a diretoria para eventuais dúvidas e solução de problemas.', 'Home', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2018-01-04 09:29:52', '2018-01-04 11:29:52', '', 2, 'http://www.ultimate.com.br/styroville/noticias/2-revision-v1/', 0, 'revision', '', 0),
(564, 3, '2018-01-04 09:41:44', '2018-01-04 11:41:44', 'Fundada em 1993, atuamos no recorte de isopor, com máquinas automáticas CNC.\r\nContamos com frota própria de caminhões facilitando e garantindo a qualidade no envio dos produtos.\r\nAuxiliamos o cliente no desenvolvimento de produtos específicos na linha de embalagens técnicas e na construção civil.\r\nTemos uma equipe de vendas treinada para o melhor atendimento, além de um canal aberto diretamente com a diretoria para eventuais dúvidas e solução de problemas.', 'Home', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2018-01-04 09:41:44', '2018-01-04 11:41:44', '', 2, 'http://www.ultimate.com.br/styroville/noticias/2-revision-v1/', 0, 'revision', '', 0),
(565, 3, '2018-01-04 09:55:42', '2018-01-04 11:55:42', 'Fundada em 1993, atuamos no segmento de POLIESTIRENO EXPa empresa conta hoje com uma variada gama de produtos, atuando nos mais variados segmentos como PAPELARIA/DECORAÇÃO, EMBALAGENS INDUSTRIAIS, CONSTRUÇÃO CIVIL, PRANCHAS PARA SURF, BLOCOS PARA USINAGEM/ESCULPIR, são dentre algumas delas.\n\nContamos hoje com uma equipe treinada e especializada no desenvolvimento de produtos que atendam a necessidade dos clientes.\n\nTemos frota própria de caminhões para garantir a qualidade dos produtos e maior agilidade nas entregas.\n\nCom máquinas automáticas CNC, temos um parque fabril amplo e com alta capacidade de produção buscando sempre atender as necessidades.', 'Conheça-nos', 'A empresa foi fundada em 1970 por um grupo de empreendedores com o objetivo de contribuir com o desenvolvimento econômico da região, gerar empregos e diversificar a atividade.', 'inherit', 'closed', 'closed', '', '196-autosave-v1', '', '', '2018-01-04 09:55:42', '2018-01-04 11:55:42', '', 196, 'http://www.ultimate.com.br/styroville/noticias/196-autosave-v1/', 0, 'revision', '', 0),
