(568, 3, '2018-01-04 13:19:29', '2018-01-04 15:19:29', '<span class=\"tel\">+55 (47) 3043-1260 Unidade Joinville SC</span>\r\n\r\n+55 (48) 3346-8711 Unidade São José SC\r\n\r\n<span class=\"tel\">vendas</span><span class=\"email\">@styroville.com.br</span>\r\n<h4>Horário de Atendimento</h4>\r\nsegunda a quinta\r\n\r\n08:00 as 12:00 - 13:00 as 18:00\r\n\r\nsexta feira\r\n\r\n08:00 as 12:00 - 13:00 as 17:00', 'Fale Conosco', ' Preencha nosso formulário e envie seu contato para nós.', 'inherit', 'closed', 'closed', '', '220-revision-v1', '', '', '2018-01-04 13:19:29', '2018-01-04 15:19:29', '', 220, 'http://www.ultimate.com.br/styroville/noticias/220-revision-v1/', 0, 'revision', '', 0),
