(580, 3, '2018-01-04 15:03:28', '2018-01-04 17:03:28', 'Fundada em 1993, atuamos no recorte de isopor, com máquinas automáticas CNC.\r\nContamos com frota própria de caminhões facilitando e garantindo a qualidade no envio dos produtos.\r\nAuxiliamos o cliente no desenvolvimento de produtos específicos na linha de embalagens técnicas e na construção civil.\r\nTemos uma equipe de vendas treinada para o melhor atendimento, além de um canal aberto diretamente com a diretoria para eventuais dúvidas e solução de problemas.', 'Home', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2018-01-04 15:03:28', '2018-01-04 17:03:28', '', 2, 'http://www.ultimate.com.br/styroville/noticias/2-revision-v1/', 0, 'revision', '', 0),
