(587, 1, '2018-01-08 13:31:35', '2018-01-08 15:31:35', 'Estamos prontos para te atender. Utilizar nossas canais de atendimentos ou envie um e-mail através do formulário abaixo.', 'Fale Conosco', ' Preencha nosso formulário e envie seu contato para nós.', 'inherit', 'closed', 'closed', '', '220-revision-v1', '', '', '2018-01-08 13:31:35', '2018-01-08 15:31:35', '', 220, 'http://www.ultimate.com.br/styroville/noticias/220-revision-v1/', 0, 'revision', '', 0),
