(12, 12, 'produtos_taxonomy', '', 0, 11),
(13, 13, 'produtos_taxonomy', 'Embalagens técnicas, calços, bups,  peças coladas, peças especiais cortadas em máquina CNC ', 0, 4),
(34, 34, 'produtos_taxonomy', 'Tavela ou capa de laje, temos os modelos moldado (somente na medida de 1250x330x70mm) e recortado em medidas conforme a necessidade', 0, 3),
(16, 16, 'clientes_taxonomy', '', 0, 0),
(17, 17, 'clientes_taxonomy', '', 0, 0),
(18, 18, 'clientes_taxonomy', '', 0, 0),
(19, 19, 'minha-area_taxonomy', '', 0, 4),
