(22, 22, 'produtos_taxonomy', '', 0, 4),
(35, 35, 'produtos_taxonomy', 'Placas EPS (Isopor) para forro, excelente isolante térmico e decorativo\r\nDisponível em modelo liso e com textura\r\nDimensão padrão 1243x618mm com espessura de 20, 25, 30, 40, ou 50mm ou ainda podemos fabricar conforme sua necessidade', 0, 12),
(24, 24, 'minha-area_taxonomy', '', 0, 0),
(38, 38, 'produtos_taxonomy', '', 0, 13),
(36, 36, 'produtos_taxonomy', '', 0, 1),
(32, 32, 'produtos_taxonomy', 'Sancas internas em EPS, fornecido em material de alta densidade, pode ser pintado ou aplicado massa acrílica, padrão comprimento 1000mm\r\nFazemos projetos sob medida', 0, 6),
(37, 37, 'produtos_taxonomy', '', 0, 2),
(33, 33, 'produtos_taxonomy', 'Moldura cimentícia em EPS revestido com argamassa, gerando grande resistência ao produto, para fins decorativos ou afim de esconder tubulações, calhas, telhados\r\nFazemos projetos sob medida como colunas falsas', 0, 10),
(39, 39, 'produtos_taxonomy', 'Fabricamos placas em Isopor para isolamento térmico em diversas medidas\r\nProduzimos também calhas para isolamento térmico de tubulações\r\nTudo em material auto extinguível', 0, 4),
(40, 40, 'produtos_taxonomy', 'Produzimos telhas em EPS para isolamento térmico de telhados, podendo ser coladas em telhas de aluzinco, fibrocimento.\r\nFabricadas nos modelos trapezoidal, ondulada ou bandeja conforme a necessidade', 0, 2),
(41, 41, 'produtos_taxonomy', 'Colunas em isopor natural ou revestidas com argamassa cimentícia com função decorativa em prédios e residências', 0, 3),
(42, 42, 'produtos_taxonomy', '', 0, 1),
(43, 43, 'produtos_taxonomy', '', 0, 1);
